BEBEDOURO - (Coluna) Especificações: Tipo: de Piso (coluna) Serpentina externa;
Termostato regulável (controle de temperatura);
Processamento de água do tipo "Gelada" e "Natural";
Torneira de alta resistência; Pingadeira (aparador de pingos de água);
Capacidade para acomodar garrafão de 20 litros;
Capacidade de processamento mínima de 1,2 litros de água gelada/hora.
Volume interno mínimo de 2 litros;
Resfriamento da água a 10 graus ou inferior
Tensão de 110V ~ 127V ou Bivolt.
Garantia de 1 ano.
